import React, { useRef, useEffect } from 'react';
import styles from './MainContent.module.css';

function MainContent({ messages, isLoading }) {
    const messagesEndRef = useRef(null);

    const scrollToBottom = () => {
        messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
    };

    useEffect(() => {
        scrollToBottom();
    }, [messages]);

    const formatAssistantMessage = (content) => {
        // First, split the content by newlines and process each line
        return content.split('\n').map((line, index) => {
            // Remove extra whitespace
            line = line.trim();
            
            if (line.startsWith('•**') && line.includes(':**')) {
                // This is a header line with a bullet point
                // Extract the header text between ** and :
                const headerStart = line.indexOf('**') + 2;
                const headerEnd = line.lastIndexOf(':**');
                const headerText = line.substring(headerStart, headerEnd);
                const remainingText = line.substring(headerEnd + 3).trim();
                
                return (
                    <div key={index} className={styles.bulletContainer}>
                        <span className={styles.bullet}>•</span>
                        <span className={styles.bulletText}>
                            <span className={styles.bold}>{headerText}:</span>
                            {remainingText ? ` ${remainingText}` : ''}
                        </span>
                    </div>
                );
            } else if (line.startsWith('•')) {
                // Regular bullet point
                return (
                    <div key={index} className={styles.bulletContainer}>
                        <span className={styles.bullet}>•</span>
                        <span className={styles.bulletText}>{line.substring(1).trim()}</span>
                    </div>
                );
            } else if (line) {
                // Regular text
                return (
                    <div key={index} className={styles.paragraph}>
                        {line}
                    </div>
                );
            }
            return null;
        }).filter(Boolean); // Remove null entries
    };

    return (
        <div className={styles.mainContent}>
            {messages.length === 0 && (
                <div className={styles.emptyState}>
                    Upload a PDF and ask questions about it!
                </div>
            )}
            {messages.map((message, index) => (
                <div 
                    key={index} 
                    className={`${styles.message} ${styles[message.type]}`}
                >
                    {message.type === 'user' && (
                        <div className={styles.avatar}>You</div>
                    )}
                    {message.type === 'assistant' && (
                        <div className={styles.avatar}>AI</div>
                    )}
                    <div className={styles.messageContent}>
                        {message.type === 'assistant' ? (
                            <div className={styles.formattedContent}>
                                {formatAssistantMessage(message.content)}
                            </div>
                        ) : (
                            message.content
                        )}
                    </div>
                </div>
            ))}
            {isLoading && (
                <div className={styles.loading}>
                    <div className={styles.loadingDots}>
                        <span></span>
                        <span></span>
                        <span></span>
                    </div>
                </div>
            )}
            <div ref={messagesEndRef} />
        </div>
    );
}

export default MainContent;
